import urllib, base64
import base64
import requests
import  pprint

def getEmotion(data):
    headers = {
        # Request headers
        'Content-Type': 'application/octet-stream',
        'Ocp-Apim-Subscription-Key': '6d239a628e9640d8b29f50bc7fbe0a6e',
    }
    data = data.split('data:image/jpeg;base64,')[1]
    decode = base64.decodebytes(bytes(data.encode('UTF-8')))
    url = 'https://westus.api.cognitive.microsoft.com/emotion/v1.0/recognize'
    r = requests.post(url, headers = headers, data = decode)
    return r.content

if __name__ == "__main__":
    print(getEmotion("data:image/jpeg;base64,"))